import React from "react";
import "./App.css";
import Header from "./components/Header";
import { Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <Container>
      <Header />
    </Container>
  );
}

export default App;
